import './Products.css';
import Card from './Card/Card';
import firstImage from '../images/51-3.png'; //временно импортирую картинки
import secondImage from '../images/59-2.png';
import thirdImage from '../images/94.png';

export default function Products() {
  return (
    <section className='products'>
      <ul className='products__list'>
        <Card image={firstImage}/>
        <Card image={secondImage}/>
        <Card image={thirdImage}/>
      </ul>
    </section>
  )
}
